('MediaObject', 'CreativeWork', 'An image, video, or audio object embedded in a web page. Note that a creative work may have many media objects associated with it on the same web page. For example, a page about a single song (MusicRecording) may have a music video (VideoObject), and a high and low bandwidth audio stream (2 AudioObject''s).', 'An image, video, or audio object embedded in a web page. Note that a creative work may have many media objects associated with it on the same web page. For example, a page about a single song (MusicRecording) may have a music video (VideoObject), and a high and low bandwidth audio stream (2 AudioObject''s).', 'Media Object', 'http://schema.org/MediaObject', 4),
('MedicalAudience', 'Audience', 'Target audiences for medical web pages. Enumerated type.', 'Target audiences for medical web pages. Enumerated type.', 'Medical Audience', 'http://schema.org/MedicalAudience', 0),
('MedicalCause', 'MedicalEntity', 'The causative agent(s) that are responsible for the pathophysiologic process that eventually results in a medical condition, symptom or sign. In this schema, unless otherwise specified this is meant to be the proximate cause of the medical condition, symptom or sign. The proximate cause is defined as the causative agent that most directly results in the medical condition, symptom or sign. For example, the HIV virus could be considered a cause of AIDS. Or in a diagnostic context, if a patient fell and sustained a hip fracture and two days later sustained a pulmonary embolism which eventuated in a cardiac arrest, the cause of the cardiac arrest (the proximate cause) would be the pulmonary embolism and not the fall. <p>Medical causes can include cardiovascular, chemical, dermatologic, endocrine, environmental, gastroenterologic, genetic, hematologic, gynecologic, iatrogenic, infectious, musculoskeletal, neurologic, nutritional, obstetric, oncologic, otolaryngologic, pharmacologic, psychiatric, pulmonary, renal, rheumatologic, toxic, traumatic, or urologic causes; medical conditions can be causes as well.\n\n\n\n        </p>', 'The causative agent(s) that are responsible for the pathophysiologic process that eventually results in a medical condition, symptom or sign. In this schema, unless otherwise specified this is meant to be the proximate cause of the medical condition, symptom or sign. The proximate cause is defined as the causative agent that most directly results in the medical condition, symptom or sign. For example, the HIV virus could be considered a cause of AIDS. Or in a diagnostic context, if a patient fell and sustained a hip fracture and two days later sustained a pulmonary embolism which eventuated in a cardiac arrest, the cause of the cardiac arrest (the proximate cause) would be the pulmonary embolism and not the fall. Medical causes can include cardiovascular, chemical, dermatologic, endocrine, environmental, gastroenterologic, genetic, hematologic, gynecologic, iatrogenic, infectious, musculoskeletal, neurologic, nutritional, obstetric, oncologic, otolaryngologic, pharmacologic, psychiatric, pulmonary, renal, rheumatologic, toxic, traumatic, or urologic causes; medical conditions can be causes as well.', 'Medical Cause', 'http://schema.org/MedicalCause', 0),
('MedicalClinic', 'MedicalOrganization', 'A medical clinic.', 'A medical clinic.', 'Medical Clinic', 'http://schema.org/MedicalClinic', 0),
('MedicalCode', 'MedicalIntangible', 'A code for a medical entity.', 'A code for a medical entity.', 'Medical Code', 'http://schema.org/MedicalCode', 0),
('MedicalCondition', 'MedicalEntity', 'Any condition of the human body that affects the normal functioning of a person, whether physically or mentally. Includes diseases, injuries, disabilities, disorders, syndromes, etc.', 'Any condition of the human body that affects the normal functioning of a person, whether physically or mentally. Includes diseases, injuries, disabilities, disorders, syndromes, etc.', 'Medical Condition', 'http://schema.org/MedicalCondition', 1),
('MedicalConditionStage', 'MedicalIntangible', 'A stage of a medical condition, such as ''Stage IIIa''.', 'A stage of a medical condition, such as ''Stage IIIa''.', 'Medical Condition Stage', 'http://schema.org/MedicalConditionStage', 0),
('MedicalContraindication', 'MedicalEntity', 'A condition or factor that serves as a reason to withhold a certain medical therapy. Contraindications can be absolute (there are no reasonable circumstances for undertaking a course of action) or relative (the patient is at higher risk of complications, but that these risks may be outweighed by other considerations or mitigated by other measures).', 'A condition or factor that serves as a reason to withhold a certain medical therapy. Contraindications can be absolute (there are no reasonable circumstances for undertaking a course of action) or relative (the patient is at higher risk of complications, but that these risks may be outweighed by other considerations or mitigated by other measures).', 'Medical Contraindication', 'http://schema.org/MedicalContraindication', 0),
('MedicalDevice', 'MedicalEntity', 'Any object used in a medical capacity, such as to diagnose or treat a patient.', 'Any object used in a medical capacity, such as to diagnose or treat a patient.', 'Medical Device', 'http://schema.org/MedicalDevice', 0),
('MedicalDevicePurpose', 'MedicalEnumeration', 'Categories of medical devices, organized by the purpose or intended use of the device.', 'Categories of medical devices, organized by the purpose or intended use of the device.', 'Medical Device Purpose', 'http://schema.org/MedicalDevicePurpose', 0);
INSERT IGNORE INTO `#__j4schema_types` (`id_types`, `ty_parent`, `ty_comment`, `ty_comment_plain`, `ty_label`, `ty_url`, `ty_children`) VALUES
('MedicalEntity', 'Thing', 'The most generic type of entity related to health and the practice of medicine.', 'The most generic type of entity related to health and the practice of medicine.', 'Medical Entity', 'http://schema.org/MedicalEntity', 17),
('MedicalEnumeration', 'MedicalIntangible', 'Enumerations related to health and the practice of medicine.', 'Enumerations related to health and the practice of medicine.', 'Medical Enumeration', 'http://schema.org/MedicalEnumeration', 16),
('MedicalEvidenceLevel', 'MedicalEnumeration', 'Level of evidence for a medical guideline. Enumerated type.', 'Level of evidence for a medical guideline. Enumerated type.', 'Medical Evidence Level', 'http://schema.org/MedicalEvidenceLevel', 0),
('MedicalGuideline', 'MedicalEntity', 'Any recommendation made by a standard society (e.g. ACC/AHA) or consensus statement that denotes how to diagnose and treat a particular condition. Note: this type should be used to tag the actual guideline recommendation; if the guideline recommendation occurs in a larger scholarly article, use MedicalScholarlyArticle to tag the overall article, not this type. Note also: the organization making the recommendation should be captured in the recognizingAuthority base property of MedicalEntity.', 'Any recommendation made by a standard society (e.g. ACC/AHA) or consensus statement that denotes how to diagnose and treat a particular condition. Note: this type should be used to tag the actual guideline recommendation; if the guideline recommendation occurs in a larger scholarly article, use MedicalScholarlyArticle to tag the overall article, not this type. Note also: the organization making the recommendation should be captured in the recognizingAuthority base property of MedicalEntity.', 'Medical Guideline', 'http://schema.org/MedicalGuideline', 2),
('MedicalGuidelineContraindication', 'MedicalGuideline', 'A guideline contraindication that designates a process as harmful and where quality of the data supporting the contraindication is sound.', 'A guideline contraindication that designates a process as harmful and where quality of the data supporting the contraindication is sound.', 'Medical Guideline Contraindication', 'http://schema.org/MedicalGuidelineContraindication', 0),
('MedicalGuidelineRecommendation', 'MedicalGuideline', 'A guideline recommendation that is regarded as efficacious and where quality of the data supporting the recommendation is sound.', 'A guideline recommendation that is regarded as efficacious and where quality of the data supporting the recommendation is sound.', 'Medical Guideline Recommendation', 'http://schema.org/MedicalGuidelineRecommendation', 0),
