('MedicalObservationalStudy', 'MedicalStudy', 'An observational study is a type of medical study that attempts to infer the possible effect of a treatment through observation of a cohort of subjects over a period of time. In an observational study, the assignment of subjects into treatment groups versus control groups is outside the control of the investigator. This is in contrast with controlled studies, such as the randomized controlled trials represented by MedicalTrial, where each subject is randomly assigned to a treatment group or a control group before the start of the treatment.', 'An observational study is a type of medical study that attempts to infer the possible effect of a treatment through observation of a cohort of subjects over a period of time. In an observational study, the assignment of subjects into treatment groups versus control groups is outside the control of the investigator. This is in contrast with controlled studies, such as the randomized controlled trials represented by MedicalTrial, where each subject is randomly assigned to a treatment group or a control group before the start of the treatment.', 'Medical Observational Study', 'http://schema.org/MedicalObservationalStudy', 0),
('MedicalObservationalStudyDesign', 'MedicalEnumeration', 'Design models for observational medical studies. Enumerated type.', 'Design models for observational medical studies. Enumerated type.', 'Medical Observational Study Design', 'http://schema.org/MedicalObservationalStudyDesign', 0),
('MedicalOrganization', 'LocalBusiness', 'A medical organization, such as a doctor''s office or clinic.', 'A medical organization, such as a doctor''s office or clinic.', 'Medical Organization', 'http://schema.org/MedicalOrganization', 8),
